const RecipesList = (data) => {
    const recipeData = data.data

    if(!recipeData) {
        return (
          <p>Loading....</p>
        )
      }

    return ( 
        <div className="recipes-list">

            { recipeData.map((recipe) => {
                <div key={recipe.id}  className="recipe-card">
                    <h2>recipe name</h2>
                    <p>recipe image</p>
                </div>
            })}

        </div>
     );
}

export default RecipesList;
